var vueCommon=new Vue({el:"#vueCommon",data:{},methods:{hidePhoneNumber:function(a){var b=a.split("-");if(b.length===2){return b[0]+"-****"}else{if(b.length===3){return b[0]+"-"+b[1]+"-****"}}return a},checkPhoneNumberType:function(d){var a=d.replace(/[^0-9]/g,"");var c=a.length;var b="";if(c<7){return d}else{if(c===7){b+=a.substr(0,3);b+="-";b+=a.substr(3,4);return b}else{if(c===8){console.log("digit 8 "+a);b+=a.substr(0,4);b+="-";b+=a.substr(4,8);return b}else{if(c===9){b+=a.substr(0,2);b+="-";b+=a.substr(2,3);b+="-";b+=a.substr(5,9);return b}else{if(c===10){if(a.substr(0,2)==="02"){b+=a.substr(0,2);b+="-";b+=a.substr(2,4);b+="-";b+=a.substr(6,4);return b}else{console.log("digit 10 and !02 "+a);b+=a.substr(0,3);b+="-";b+=a.substr(3,3);b+="-";b+=a.substr(6,4);return b}}else{if(c===11){b+=a.substr(0,3);b+="-";b+=a.substr(3,4);b+="-";b+=a.substr(7,4);return b}}}}}}},separateMemo:function(h,e,g){if(h===null||h===""){return"<div class='center'>-</div>"}var j=h.split("{}");var f=e.split("{}");var l=g.split("{}");var a="";for(var d=0,k=j.length;d<k;d++){var h=j[d];var b=f[d];var c=l[d];a+="<div>"+b+" <i class='fa fa-arrow-circle-o-right'></i> "+h;a+="<small>("+c+")</small>";a+="</div>"}return a},extractDateFromDateTime:function(a){if(a){return new moment(a).format("YYYY-MM-DD")}return"날짜없음"},replaceSlashes:function(a){return a.replace(/\\/gi,"")}}});